    console.log("".concat(ReturnInfoMessage("NAME"), "\n    ").concat(ReturnBoldMessage("feasy"), " \u2013 command line for creating Stateful and Stateless widgets and screens\n\n").concat(ReturnInfoMessage("OPTIONS"), "\n    ").concat(ReturnBoldMessage("screen \"screen name\""), "      Create Flutter Screen Widget by default screen is Stateless, you use s or --screen instead of screen\n   \n    ").concat(ReturnBoldMessage("widget \"widget name\""), "      Create Flutter Widget by default widget is Stateless, you use w or --widget instead of widget\n   \n    ").concat(ReturnBoldMessage("stateful"), "                  Create Stateful Widget or Screen, you can use full or f instead of stateful\n   \n    ").concat(ReturnBoldMessage("stateless"), "                 Create Stateless Widget or Screen, you can use less or l instead of stateless\n   \n    ").concat(ReturnBoldMessage("appbar"), "                    Add AppBar to your screen, you can use a or --appbar instead of appbar\n   \n    ").concat(ReturnBoldMessage("bottomnavigationbar"), "       Add Bottom Navigation Bar to your screen, b or --bottomnavigationbar instead of bottomnavigationbar\n   \n").concat(ReturnInfoMessage("NOTE"), "\n    screens is created in lib/screens folder\n    widgets is created in lib/widgets folder\n    Btw: be sure to run feasy in your flutter root directory\n   \n").concat(ReturnInfoMessage("EXAMPLES"), "\n    ").concat(ReturnBoldMessage("The command:"), "\n        feasy screen \"hello world\" appbar bottomnavigationbar\n        -> will create a screen named hello_world.dart in lib/screens folder with AppBar and BottomNavigationBar\n\n    ").concat(ReturnBoldMessage("The command:"), "\n        feasy widget \"category list\" stateful\n        -> will create a stateful widget named category_list.dart in lib/widgets folder\n   "));
